import {MDBCard, MDBCardBody, MDBCardText, MDBCardTitle,MDBIcon} from 'mdbreact'

function editaccount(){
    return (
      <div style={{ heigh: "100vh" }}>
        <MDBCard style={{ width: "60rem" }}>
          <MDBCardTitle>
            <MDBIcon icon="cog" size="lg"/> &nbsp;
            Edit Account
          </MDBCardTitle>
          <MDBCardBody>
            <MDBCardText></MDBCardText>
          </MDBCardBody>
        </MDBCard>
      </div>
    );
}
export default editaccount
